import React, { useContext, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { ThemeContext } from "../../hooks/DarkMode/DarkModeContext";
import { UserContext } from "../../hooks/UserHooks/userContextApp";
import { toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import MenuIcon from "@mui/icons-material/Menu";
import SunIcon from "../Navbar/ImagesNavBar/Sunny.png";
import MoonIcon from "../Navbar/ImagesNavBar/Moon.png";
import SearchIcon from "../Navbar/ImagesNavBar/SearchIcon.png";
import Jobs from "../Navbar/ImagesNavBar/Jobs.png";
import styleNav from "../Navbar/Navbar.module.css";

const NavBar = () => {
  const { isSun, handleIconClick } = useContext(ThemeContext);
  const [isExpanded, setIsExpanded] = useState(false);
  const { userInformation, setUserInformation } = useContext(UserContext);
  const navigate = useNavigate();

  const handleSearchIconClick = () => {
    setIsExpanded(!isExpanded);
  };

  const handleLogout = () => {
    // Confirm logout with the user
    const confirmLogout = window.confirm("Are you sure you want to log out?");
    if (confirmLogout) {
      setUserInformation(null);
      localStorage.removeItem("userInformation");
      localStorage.removeItem("token");
      navigate("/");
      toast.success('Logged out successfully'); // Set toast message
    }
  };

  return (
    <header className={styleNav.header}>
      <nav className={`${styleNav.container_nav} ${isSun ? styleNav.dark : styleNav.light}`}>
        <div className={styleNav.logoContainer}>
          <img className={styleNav.logo} src={Jobs} alt="jobs" />
        </div>

        <ul className={styleNav.linkList}>
          {/* Your navigation links */}
          {userInformation?.isAdmin && (
            <>
              <li>
                <Link className={styleNav.link} to={"/"}>
                  About
                </Link>
              </li>
              <li>
                <Link className={styleNav.link} to={"/FindTheOne"}>
                  FindTheOne
                </Link>
              </li>
              <li>
                <Link className={styleNav.link} to={"/favCards"}>
                  Favorite Cards
                </Link>
              </li>
              <li>
                <Link className={styleNav.link} to={"/myCards"}>
                  My Cards
                </Link>
              </li>
              <li>
                <Link className={styleNav.link} to={"/sandBox"}>
                  SandBox
                </Link>
              </li>
            </>
          )}
          {userInformation?.isBusiness && (
            <>
              {/* <li>
                <Link className={styleNav.link} to={"/Bla"}>
                  bla
                </Link>
              </li> */}
              <li>
                <Link className={styleNav.link} to={"/"}>
                  About
                </Link>
              </li>
              <li>
                <Link className={styleNav.link} to={"/FindTheOne"}>
                  FindTheOne
                </Link>
              </li>
              <li>
                <Link className={styleNav.link} to={"/myCards"}>
                  My Cards
                </Link>
              </li>
            </>
          )}
          {!userInformation?.isAdmin && !userInformation?.isBusiness && userInformation && (
            <>
              <li>
                <Link className={styleNav.link} to={"/"}>
                  About
                </Link>
              </li>
              <li>
                <Link className={styleNav.link} to={"/FindTheOne"}>
                  FindTheOne
                </Link>
              </li>
            </>
          )}
          {!userInformation && !userInformation?.isAdmin && !userInformation?.isBusiness && (
            <>
              <li>
                <Link className={styleNav.link} to={"/"}>
                  About
                </Link>
              </li>
            </>
          )}

          <div className={styleNav.moveRight}>
            <li>
              <div className={styleNav.searchBar}>
                <input
                  className={isExpanded ? `${styleNav.expanded} ${styleNav.searchInput}` : styleNav.searchInput}
                  type="text"
                  placeholder="Search Your Card..."
                />
                <img
                  src={SearchIcon}
                  alt="Search Icon"
                  onClick={handleSearchIconClick}
                  className={
                    isExpanded ? `${styleNav.searchIcon} ${styleNav.searchIconMoved}` : styleNav.searchIcon
                  }
                />
              </div>
            </li>
            <li>
              <img
                src={isSun ? SunIcon : MoonIcon}
                alt="Sun Icon"
                onClick={handleIconClick}
                className={styleNav.moon_sun_icon}
              />
            </li>
            <li>
              {userInformation ? (
                <button className={styleNav.link} onClick={handleLogout}>
                  Logout
                </button>
              ) : (
                <Link className={styleNav.link} to={"/register"}>
                  Register
                </Link>
              )}
            </li>
          </div>
        </ul>

        {/* Hamburger icon */}
        <li className={styleNav.hamburger}>
          <MenuIcon />
        </li>
      </nav>
    </header>
  );
};

export default NavBar;
